import React from 'react';
import LoadPage from './views/LoadPage';
import Header from './components/layout/Header';
import Logo from './components/Logo'
import Sand from './assets/vehicles/sandcrawler.png'
import Button from './components/Button';
import Card from './components/Card';
import CardCheckout from './components/CardCheckout';
import { FontAwesomeIcon }from '@fortawesome/react-fontawesome'
import { faBarcode, faCreditCard } from '@fortawesome/free-solid-svg-icons'

function App() {
  return (
    <div className="w-full h-screen flex- flex-col ustify-center items-center" >
      <CardCheckout img={Sand}
                    alt={'Car'}
                    name={'Sand Crawler'}
                    company={'Trash Nomades'}
                    price={1400000} />
      <div className="space-x-20">
        <FontAwesomeIcon className="text-7xl text-green-500 hover:text-green-300" icon={faCreditCard} />
        <FontAwesomeIcon className="text-7xl hover:text-gray-400" icon={faBarcode} />
      </div>
    </div>
  );
}

export default App;
